There is not one universe, but there are many, which is a multiverse. Supposing you are just one person, there are many other versions of you in the other universes, there are ways to travel, but only a police agency,MVA, can travel only for police procedures. Gabriel Yulaw (Jet Li)is a former MVA agent, who killed another version of himself in self-defense. It made the other versions of him stronger. When Yulaw found out about this, he became power-hungry killing the 122 other versions for two years. After killing Lawless (also played by Jet)and getting captured by his former partner Roedecker (Delroy Lindo) and a new MVA agent Funsch (Jason Statham) Yulaw managed to escape the prison and is trying to kill his last target, Gabe Law (also played by Jet) who is a police officer. He is also at Yulaw's strength. Roedecker and Funsch now have to arrest Yulaw before he can kill Gabe. There is a possibility that the universe could die or make Yulaw invinible. After encountering Yulaw for the first time, Gabe thought that it was his split personality, but it wasn't. Will Gabe be able to confront Yulaw before or after Yulaw ruins his life? Written by Zero 88

This movie postulates what if there is more than one universe. And that all of these universes are held together by one single stream of energy and that energy is equally distributed to every living in each universe and if one of these beings die, that energy is reallocated equally to each other surviving member. And with each allocation, a person becomes stronger. Now one universe has master the ability of crossing into another universe, and a man named Shulaw who believes that if he can kill all of his counterparts, he will become invincible, but there are those who believe that it might have detrimental effects, so try and stop him. Unfortunately, he just has one more person to kill, Gabe Law, but the officers follow Shulaw but Shulaw has committed some crimes and Gabe is accused and is wanted. But Gabe discovers that he has changed and only wants to kill Shulaw not realizing what could happen. Written by &lt;a class=&quot;__cf_email__&quot; href=&quot;/cdn-cgi/l/email-protection&quot; data-cfemail=&quot;4133223271757070013820292e2e6f222e&quot;&gt;[email&amp;#160;protected]&lt;/a&gt;&lt;script data-cfhash='f9e31' type=&quot;text/javascript&quot;&gt;
